import React from 'react';

import './css/index.css';
import './css/catalog.css';
import './css/catalog1.css';
import './css/catalog2.css';
import './css/catalog4.css';
import './css/catalog5.css';
import './css/catalog6.css';


import Header from "./Header";
import Three_Product from "./catalaug-3-product/Three_Product";
import Four_Products from "./catalaug-4-product/Four_Products";
import Top_Slide from "./top-slider/Top_Slide";
import Two_Card from "./two-card/Two_Card";
import Three_Cards from "./Three_Cards";


function App(){
return(
<>

    <Header></Header>
    <Top_Slide></Top_Slide>
    <div>
        <Two_Card></Two_Card>
       
    </div>
    <div>
    <Three_Product />
    <Four_Products />
    </div>
    <div>
     <Three_Cards />
    </div>


</>
);
}

export default App;
